import React from 'react';
import './Button.css';

const Button = (props) => {
    const properties = {
        name: 'button',
        className: 'button-calc',
        type: props.type,
        children: props.children
    }
    return (
        <button type={props.type} className="button-calc">{props.children}</button>
    );
}

export default Button;
